 export default (state , action) =>{
    switch(action.type)
    {
        case  "DELETE_TRANSACTION":
        return{
...state,
transcation: state.transcation.filter(transcation =>  transcation.id !== action.payload)
        }
        default:
            return state; 
    }
 }
